file = open("/Users/yoon/python/safehouse.txt", "r")

wktList = []

while True:
    line = file.readline()
    if not line:
        break
    line.strip("'")
    line.lstrip("'")
    latilong = (line.strip()).split(',')

    lati = float(latilong[0])
    longi = float(latilong[1])
    lati_PLUS_longi = [lati, longi]
    if lati_PLUS_longi in wktList:
        pass
    wktList.append(lati_PLUS_longi)
    

#print(wktList)

house_node_wkt = {}
num = 0
for i in wktList:
    
    num = num + 1
    house_node_wkt[num] = i

print(house_node_wkt)

